import React, { Component, useState } from "react";
import { connect } from "react-redux";

export default class Formulario extends Component {
  render() {
    const [FormData, setformData] = useState({
      nome: "",
      email: "",
      mensagem: "",
      telefone: ""
    });

    const { nome, email, mensagem, telefone } = FormData;

    return (
      <div>
        <form>
          <div className="form-group">
            <input type="text" value={nome} placeholder="Digite o seu nome" />
          </div>
          <div className="form-group">
            <input type="email" value={email} placeholder="Qual seu e-mail?" />
          </div>
          <div className="form-group">
            <input placeholder="Digite seu telefone com DDD" />
          </div>
          <div className="form-group">
            <textarea placeholder="Digite o que nos deseja enviar" />
            <small id="emailHelp" class="form-text text-white">
              Iremos responder o mais rápido possível!
            </small>
          </div>
          <div className="form-group">
            <button type="submit" class="btn btn-primary">
              Enviar
            </button>
          </div>
        </form>
      </div>
    );
  }
}
